import React from 'react';
import { Container } from '@mui/material';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Grid2 from '@mui/material/Unstable_Grid2/Grid2';

const Welcome = ({ nextStep }) => {
    return (
        console.log(nextStep),
        <Container>
            <Box>
                <Grid2 container spacing={2}>
                    <Grid2 item xs={4}>
                        <Typography variant="body1" gutterBottom>
                            In this assessment, we will ask you a series of questions to determine how well you are doing with Agile.
                        </Typography>
                    </Grid2>
                    <Grid2 item xs={4}>
                        <Typography variant="body2" gutterBottom>
                            There are 3 steps:
                            First, we will ask you some questions about your delivery frequency.

                            <Divider>
                                Then we will ask you some questions about your business.
                            </Divider>
                            And finally, we will ask you some questions about your processes.
                        </Typography>
                    </Grid2>
                </Grid2>
                <Button variant="contained" color="primary" type="button" onClick={nextStep} sx={{ mx: "auto" }}>
                    START
                </Button>
            </Box>
        </Container>
    );
};
export default Welcome;
